import 'bootstrap/dist/css/bootstrap.min.css';

export default class MajorRow extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div className="majorResults">
				<div className="title">{this.props.title}</div>
			</div>
		);
	}
}
